import {Link, Routes, Route} from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <h1>Index Page</h1>
      <div>
        <ul>
          <li><Link to="/">Index</Link></li>
          <li><Link to="/home">Home</Link></li>
        </ul>
      </div>
      <div>
        <Routes>
          <Route exact path="/"><APP/></Route>
          <Route exact path="/home"><Home/></Route>
        </Routes>
      </div>
    </div>
  );
}

export default App;
